Hidup adalah kumpulan hal-hal kecil yang mungkin sering kita lupakan. Selain menyelesaikan target pekerjaan, jangan lupa luangkan waktu untuk keluarga. Bercengkrama dengan keluarga, walau mungkin hanya via video call; beraktivitas bersama seperti mendampingi anak belajar, bermain, dll. Mungkin tak semua terlihat berarti. Namun kelak resultan semua itu bisa memberikan kita keberhasilan. 

